import logo from "./logo.svg";
import "./App.css";
import { Container } from "reactstrap";

const App = () => {
  return (
    <Container>
      <h1>
        <h2>
          <h6>
            <p>Wenas</p>
          </h6>
        </h2>
      </h1>
    </Container>
  );
};

export default App;
